import React from 'react';

function Fetch () {
	
	fetch( "https://dog.ceo/api/breeds/image/random" )
	.then( x => x.json() )
	.then(x => {
		console.log( x );
		var perrito = x.message;
	})
	
	return ( 
		<section className="fetch">
			<h2>Fetch</h2>
			<img src={perrito} alt="GUAU!" />
		</section>
	)
};

export default Fetch;
